  x[58] = y[58] / (187.303000 * YOW);
  x[59] = y[59] / (187.303000 * YOW);
  x[60] = y[60] / (154.297000 * YOW);
  x[61] = y[61] / (219.301000 * YOW);
  x[62] = y[62] / (202.294000 * YOW);
